import { useState, useEffect, useContext } from 'react';
import PropTypes from 'prop-types';
import { Tabs, Tab, Box, Button, Icon, Hidden } from '@mui/material';
import { useTranslation } from 'react-i18next';
import { useForm } from 'react-hook-form';
import { makeStyles } from '@mui/styles';
import { useSelector } from 'react-redux';
import Parameter from './tabs/Parameter';
import LineToLineComparison from './tabs/LineToLineComparison';
import LogAnalysis from './tabs/LogAnalysis';
import NavbarToggleButton from '../../../fuse-layouts/shared-components/NavbarToggleButton';
import AnalysisContext from '../Analysis-context/AnalysisContext';

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box className="p-10">
          <div>{children}</div>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.number.isRequired,
  value: PropTypes.number.isRequired,
};

const useStyles = makeStyles({
  inputNumber: {
    '& input[type=number]::-webkit-inner-spin-button, input[type=number]::-webkit-outer-spin-button':
      {
        '-webkit-appearance': 'none',
        margin: '0',
      },

    '& input[type=number]': {
      '-moz-appearance': 'textfield',
    },
  },
  tableDistance: {
    '& tr td:last-child': {
      width: '80px',
      maxWidth: '80px',
    },
    '& tr th:last-child': {
      width: '80px',
      maxWidth: '80px',
    },
  },
});

export default function Analysis(props) {
  const { isOwnReady, isAuthorityReady, isauthorityCompanyReady } = useContext(AnalysisContext);
  const configFuse = useSelector(({ fuse }) => fuse.settings.current.layout.config);
  const navbar = useSelector(({ fuse }) => fuse.navbar);

  const { t } = useTranslation('analysisPage');
  const classes = useStyles();

  const methods = useForm({
    mode: 'onChange',
    defaultValues: {},
  });
  const { reset, watch, control, onChange, formState } = methods;
  const form = watch();
  const travelApp = watch('travelApp');

  const [value, setValue] = useState(0);
  const [fielName, setFielName] = useState('');

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  useEffect(() => {
    console.log('travelApp', travelApp);
  }, [travelApp]);

  const [permissibleErrors, setPermissibleErrors] = useState({
    frontDoorEntrance: 3,
    frontDoorExit: 3,
    backDoorEntrance: 3,
    backDoorExit: 3,
    times: 15,
  });

  function createData(name, calories, fat) {
    return { name, calories, fat };
  }

  const dopDistancePermissibleErrors = [
    createData(0.0, 0.01, 5),
    createData(0.01, 0.3, 20),
    createData(0.3, 0.6, 40),
    createData(0.6, 1.0, 100),
  ];

  return (
    <div className="px-10">
      {configFuse.navbar.display && configFuse.navbar.position === 'left' && (
        <>
          <Hidden lgDown>
            {(configFuse.navbar.style === 'style-3' ||
              configFuse.navbar.style === 'style-3-dense') && (
              <NavbarToggleButton className="w-20 h-20 p-0 mx-0" />
            )}

            {configFuse.navbar.style === 'style-1' && !navbar.open && (
              <NavbarToggleButton className="w-20 h-20 p-0 mx-0" />
            )}
          </Hidden>

          <Hidden lgUp>
            <NavbarToggleButton className="w-20 h-20 p-0 mx-0 sm:mx-8" />
          </Hidden>

          <Hidden lgUp>
            <Button
              onClick={(ev) => props.pageLayout.current.toggleLeftSidebar()}
              aria-label="open left sidebar"
              className="w-20 h-20 p-0 mx-0 sm:mx-8 min-w-min	"
            >
              <Icon fontSize="inherit" className="text-16">
                menu
              </Icon>
            </Button>
          </Hidden>
        </>
      )}

      <Box sx={{ width: '100%' }}>
        <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
          <Tabs
            variant="scrollable"
            value={value}
            onChange={handleChange}
            aria-label="basic tabs example"
          >
            <Tab
              label={t('PARAMETER')}
              id={`simple-tab-${0}`}
              aria-controls={`simple-tabpanel-${0}`}
            />
            <Tab
              label={t('LINE_TO_LINE_COMPARISON')}
              id={`simple-tab-${1}`}
              aria-controls={`simple-tabpanel-${1}`}
              disabled={!isOwnReady || !isAuthorityReady}
            />
            <Tab
              label={t('LOG_ANALYSIS')}
              id={`simple-tab-${2}`}
              aria-controls={`simple-tabpanel-${2}`}
              disabled={!isOwnReady || !isauthorityCompanyReady}
            />
          </Tabs>
        </Box>
        <TabPanel value={value} index={0}>
          <Parameter {...{}} />
        </TabPanel>
        <TabPanel value={value} index={1}>
          <LineToLineComparison {...{}} />
        </TabPanel>
        <TabPanel value={value} index={2}>
          <LogAnalysis {...{}} />
        </TabPanel>
      </Box>
    </div>
  );
}
